" data-mce-style="font-size: 12pt;"><strong>        </strong></span><span style="font-size: 14pt;" data-mce-style="font-size: 14pt;"><strong>umyjemy twoj swiat</strong></span></span></span><span style="font-family: Arial Black; font-size: 24pt;" data-mce-style="font-family: Arial Black; font-size: 24pt;"></span></div><div class="clear"></div></div></div><div style="left: 0px; top: 0px; clear: both; width: auto;" class="module module-Menu"><div class="module-content ma-center tm-menu tm-menu-6" style="background-position: 100% 100%; margin: 20px; padding: 0px; border-radius: 10px; border: 0px solid currentColor; width: 918px; height: auto; background-repeat: repeat-y; background-size: 100% 100%;"><ul class="menu"><li attr="6093" class="root"><a href="/">Strona glowna</a></li><li attr="9366" class="root"><a href="/kontakt.html">Kontakt</a></li><li attr="9337" class="root"><a href="/oferta.html">Oferta</a></li><li attr="1094" class="root"><a href="/realizacje.html">Realizacje</a></li><li attr="3817" class="root"><a href="/odsniezanie.html">Odsniezanie</a></li><li attr="8301" class="root"><a href="/ogrody.html">Ogrody</a></li></ul></div></div></div><div id="col960menu" class="column col960menu"></div><div id="col960content" class="column col960content"><div class="module module-text" style="clear: both; width: auto;"><div style=""></div></div><div class="module module-text" style="left: 0px; top: 0px; clear: both; width: auto;"><div style=""><div style="text-align: center;"><span style="font-family: Trebuchet MS; font-size: 12pt;"></span></div></div></div><div class="module module-text" style="clear: both; width: auto;"><div style="border-radius: 10px 10px 10px 10px;"><span style="font-family: Arial Black;" data-mce-style="font-family: Arial Black;"><!--[if gte mso 9]><xml>
<o:OfficeDocumentSettings>
<o:AllowPNG></o:AllowPNG>
</o:OfficeDocumentSettings>
</xml><![endif]--></span><div style="text-align: center;" data-mce-style="text-align: center;"><span style="font-family: Arial Black; font-size: 18pt;" data-mce-style="font-family: Arial Black; font-size: 18pt;">Szanowni Panstwo,<br><br></span></div><div style="text-align: center;" data-mce-style="text-align: center;"><span style="font-family: Arial Black; font-size: 18pt;" data-mce-style="font-family: Arial Black; font-size: 18pt;">Uprzejmie informujemy, iz przedmiotem naszej dzialalnosci jest zapewnienie kompleksowej uslugi utrzymania czystosci. Jestesmy firma, ktora posiada duze doswiadczenie na rynku uslug porzadkowych, o czym swiadczy miedzy innymi fakt, iz obslugujemy obiekty o lacznej powierzchni okolo 190.000.00 m2<br><br></span></div><div style="text-align: center;" data-mce-style="text-align: center;"><span style="font-family: Arial Black; font-size: 18pt;" data-mce-style="font-family: Arial Black; font-size: 18pt;">Nasza firma od lat zajmuje sie profesjonalnym zakladaniem ogrodow:</span></div><div style="text-align: center;" data-mce-style="text-align: center;"><span style="font-family: Arial Black; font-size: 18pt;" data-mce-style="font-family: Arial Black; font-size: 18pt;">- Nasadzen roslin, drzew i zywoplotow</span></div><div style="text-align: center;" data-mce-style="text-align: center;"><span style="font-family: Arial Black; font-size: 18pt;" data-mce-style="font-family: Arial Black; font-size: 18pt;">- Zakladaniem trawnikow sianych i z rolki oraz systemow nawodnienia,</span></div><div style="text-align: center;" data-mce-style="text-align: center;"><span style="font-family: Arial Black; font-size: 18pt;" data-mce-style="font-family: Arial Black; font-size: 18pt;">- Pielegnacja terenow zielonych.<br><br></span></div><div style="text-align: center;" data-mce-style="text-align: center;"><span style="font-family: Arial Black; font-size: 18pt;" data-mce-style="font-family: Arial Black; font-size: 18pt;">Rozwijamy sie preznie i dynamicznie, szybko reagujemy na rosnace wymagania rynku, stale poszerzamy nasza oferte, podejmujac sie nowych zlecen. Korzystamy z wysokiej jakosci preparatow przyjaznych dla srodowiska oraz sprzetu renomowanych firm swiatowych.</span></div><span style="font-family: Arial Black; font-size: 18pt;" data-mce-style="font-family: Arial Black; font-size: 18pt;"><!--[if gte mso 9]><xml>
